import Link from 'next/link';
import { Flex, List, ListItem, Heading } from '@chakra-ui/core';

const Nav = () => (
  <Flex justify="center">
    <List>
      <ListItem>
        <Link href="/history">
          <a><Heading></Heading>History</a>
        </Link>
      </ListItem>
      <ListItem>
        <Link href="/">
          <a><Heading></Heading>Home</a>
        </Link>
      </ListItem>
    </List>
  </Flex>
);

export default Nav;
